  /**
   * The type of device this is.
   */
  public enum class DeviceType(
    override val `value`: Int,
  ) : WireEnum {
    UNKNOWN(0),
    ANDROID(1),
    CHROME(2),
    IOS(3),
    BROWSER(4),
    OSX(5),
    ;

    public companion object {
      @JvmField
      public val ADAPTER: ProtoAdapter<DeviceType> = object : EnumAdapter<DeviceType>(
        DeviceType::class, 
        PROTO_3, 
        DeviceType.UNKNOWN
      ) {
        override fun fromValue(`value`: Int): DeviceType? = DeviceType.fromValue(`value`)
      }

      @JvmStatic
      public fun fromValue(`value`: Int): DeviceType? = when (`value`) {
        0 -> UNKNOWN
        1 -> ANDROID
        2 -> CHROME
        3 -> IOS
        4 -> BROWSER
        5 -> OSX
        else -> null
      }
    }
  }
